	public void route_head(MongoDatabase database) {

		database.getCollection("route_head").drop();
		database.createCollection("route_head");
		MongoCollection<Document> collection = database.getCollection("route_head");
		List<Document> documents = new ArrayList<Document>();
		String[] insert_data_Array = head_data.split("\\}\\,\\{");
		for (int i = 0; i < insert_data_Array.length; i++) {
			String[] insert_data_Array1 = insert_data_Array[i].split(",");
			Document headData = new Document();
			for (int j = 0; j < insert_data_Array1.length; j++) {
				headData.append(insert_data_Array1[j].split(":")[0].replaceAll("\"", ""),
						insert_data_Array1[j].split(":")[1].replaceAll("\"", ""));
			}
			documents.add(headData);
		}

		System.out.println(documents.size());
		collection.insertMany(documents);

	}

	public void route_stages(MongoDatabase database) {
		database.getCollection("route_stages").drop();
		database.createCollection("route_stages");
		MongoCollection<Document> collection = database.getCollection("route_stages");
		List<Document> documents = new ArrayList<Document>();
		String[] insert_data_Array = stage_data.split("\\}\\,\\{");
		for (int i = 0; i < insert_data_Array.length; i++) {
			Document headData = new Document();
			headData.append(insert_data_Array[i].split("\",\"")[0].split(":")[0].replaceAll("\"", ""),
					insert_data_Array[i].split("\",\"")[0].split(":")[1].replaceAll("\"", ""));
			String[] insert_data_Array1 = insert_data_Array[i].split("\",\"")[1].split(":")[1].replaceAll("\"", "")
					.split(",");
			for (int j = 0; j < insert_data_Array1.length; j++) {
				headData.append("STAGES " + j, insert_data_Array1[j]);
			}
			documents.add(headData);
		}

		System.out.println(documents.size());
		collection.insertMany(documents);

	}

